import { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { ArrowLeft } from 'react-feather';

export default function Header({ selectedMember, setSelectedMember }) {
  const { user, logout, timezone, setTimezone } = useAuth();
  const [members, setMembers] = useState([]);
  const [activeTab, setActiveTab] = useState('all');

  useEffect(() => {
    const fetchMembers = async () => {
      try {
        const res = await fetch('http://localhost:5000/api/members', {
          credentials: 'include',
        });
        const data = await res.json();
        setMembers(data);
      } catch (error) {
        console.error('Error fetching members:', error);
      }
    };

    if (user) fetchMembers();
  }, [user]);

  const handleTabClick = (tab) => {
    setActiveTab(tab);
    setSelectedMember(tab === 'all' ? 'all' : null);
  };

  return (
    <div className="app-header">
      <div className="header-top">
        <div className="header-left">
          <h1>Team Synchro</h1>
          <div className="breadcrumb">
            <span>Team Schedule</span>
            <span className="separator">/</span>
            <span className="current">Team Availability</span>
          </div>
          <p className="subtitle">View everyone's schedule and availability at a glance</p>
        </div>
        <div className="header-right">
          <div className="user-controls">
            {user && (
              <select
                value={timezone}
                onChange={(e) => setTimezone(e.target.value)}
                className="timezone-select"
              >
                <option value="Asia/Kolkata">IST</option>
                <option value="UTC">UTC</option>
                <option value="America/New_York">EST</option>
                <option value="Europe/London">GMT</option>
              </select>
            )}
            <div className="user-profile">
              {user ? (
                <>
                  <span className="user-name">{user.name}</span>
                  <button className="logout-btn" onClick={logout}>
                    Logout
                  </button>
                </>
              ) : (
                <button className="login-btn" onClick={() => window.location.href = 'http://localhost:5000/auth/google'}>
                  Login with Google
                </button>
              )}
            </div>
          </div>
        </div>
      </div>

      {user && (
        <div className="header-tabs">
          <div className="tab-group">
            <button
              className={`tab-button ${activeTab === 'all' ? 'active' : ''}`}
              onClick={() => handleTabClick('all')}
            >
              <span className="tab-icon">ðŸ“…</span>
              All Events
            </button>
            <button
              className={`tab-button ${activeTab === 'meetings' ? 'active' : ''}`}
              onClick={() => handleTabClick('meetings')}
            >
              <span className="tab-icon">ðŸ‘¥</span>
              Meetings
            </button>
            <button
              className={`tab-button ${activeTab === 'focus' ? 'active' : ''}`}
              onClick={() => handleTabClick('focus')}
            >
              <span className="tab-icon">ðŸŽ¯</span>
              Focus Time
            </button>
            <button
              className={`tab-button ${activeTab === 'personal' ? 'active' : ''}`}
              onClick={() => handleTabClick('personal')}
            >
              <span className="tab-icon">ðŸŒŸ</span>
              Personal
            </button>
          </div>
        </div>
      )}
    </div>
  );
}
